import PropTypes from "prop-types";
import { NavLink } from "react-router-dom";
import React, { Component } from "react";
import { Button, Menu } from "semantic-ui-react";

class NavBar extends Component {
  mapQuizButton = (
    <Button
      position={"left"}
      style={{ marginLeft: "0.5em" }}
      id="mapquiz-link"
      as="a"
    >
      <NavLink id="mapquiz-text" exact to="/">
        <img id="logo" src={require("../favicon.ico")}></img>MapQuiz
      </NavLink>
    </Button>
  );

  loginButton = (
    <Button
      className="nav-link"
      position={null}
      id="login-button"
      as="a"
      style={{ marginLeft: "0.5em" }}
      onClick={this.props.handleLoginClick}
    >
      Login
    </Button>
  );

  logoutButton = (
    <Button
      className="nav-link"
      as="a"
      style={{ marginLeft: "0.5em" }}
      id="logout-button"
      onClick={this.props.handleLogoutClick}
    >
      <NavLink exact to="/">
        Logout
      </NavLink>
    </Button>
  );

  playButton = (
    <Button className="nav-link" id="play-link" as="a">
      <NavLink exact to="/play">
        Play
      </NavLink>
    </Button>
  );

  statsButton = (
    <Button className="nav-link" id="stats-link" as="a">
      <NavLink exact to="/stats">
        Stats
      </NavLink>
    </Button>
  );

  render() {
    return (
      <React.Fragment>
        {this.mapQuizButton}
        {this.props.user ? this.loginButton : null}
        {this.props.user ? this.logoutButton : null}
        {this.props.user && this.props.page !== "/play" ? this.playButton : null}
        {this.statsButton}
      </React.Fragment>
    );
  }
}

export default NavBar;
